INSERT INTO artisans_values VALUES(16035,748,'OTHER_FEATURES','Fullsuits are built with approximately 50% lycra to ensure a form fitting and passively cooled suit. All padding is 3D printed.');
INSERT INTO artisans_values VALUES(16036,748,'OTHER_FEATURES','Head lining is detachable. The head ''cowl'' including the ears is also detachable from the mask itself for washing. The entire head is screwed together to ensure broken parts can be replaced.');
INSERT INTO artisans_values VALUES(16037,748,'OTHER_FEATURES','The head contains moveable eyelid mechanisms and a moveable tongue mechanism. Eyelids can be adjusted to three ''expressions''; neutral, down (grumpy), or up (innocent). Heads come with both follow-me and forward facings eyes, which are magnetically snapped into place.');
